import React, { Component } from "react";
import Post from "./Post";

class Posts extends Component {
  render() {
    let posts = [
      { id: 123, title: "banana one", author: "wuff" },
      { id: 321, title: "fruitt one", author: "meaw" },
      { id: 534, title: "health one", author: "ding" },
      { id: 674, title: "inject one", author: "ding" },
    ];
    return (
      <div className="posts">
        {/* <Post post={posts.at(0)} />
        <Post post={posts.at(1)} />
        <Post post={posts.at(2)} />
        <Post post={posts.at(3)} /> */}
        {posts.forEach((post) => (
          <Post key={post.id} post={post} />
        ))}
      </div>
    );
  }
}

export default Posts;
